6]]]}, "time_period_coverage_start": "2014-03-01", "type": "maps", "responsible_organization": {"fr": "Agence canadienne d'inspection des aliments", "en": "Health Canada,Canadian Food Inspection Agency"}, "status": "completed", "topic_category": ["environment"], "aggregate_identifier": "", "responsible_role": "pointOfContact", "date_published": "2014-12-09", "license_id": "ca-ogl-lgo", "time_period_coverage_end": "9999-09-01", "hierarchy_level": "dataset", "name": "10000000", "date_modified": "2015-01-01", "url": "...GeoNetworkServer.../csw?service=CSW&version=2.0.2&request=GetRecordById&outputSchema=csw:IsoRecord&id=00000000-0000-0000-0000-000000000001", "notes": {"fr": "Les données énumèrent les zones réglementées pour l’agrile du frêne (Agrilus planipennis). Ces zones représentent des limites des municipalités régionales, municipalités régionales de comté et les limites de canton. Afin de ralentir la propagation de l'agrile du frêne dans de nouvelles régions, l'Agence canadienne d’inspection des aliments (ACIA) a recours à des mesures visant à limiter le mouvement des matières potentiellement infestées. Le ralentissement de la propagation de l'agrile du frêne aidera à protéger l'environnement et les ressources forestières du Canada, ainsi qu'à maintenir l'accès aux marchés internationaux pour l'industrie forestière et les pépinières dans les régions non réglementées de l'Ontario, du Québec et du reste du Canada.", "en": "The data list the regulated areas for the emerald ash borer (Agrilus planipennis). The areas represent Regional Municipality Boundaries, Regional County Municipalities, and Township boundaries. To slow the spread of the emerald ash borer (EAB) to new areas, the Canadian Food Inspection Agency (CFIA) uses measures to control the movement of potentially infested materials. Slowing the spread of emerald ash borer will protect Canada's environment and forest resources. It also helps keep international markets open to the forest industry and nurseries in non-regulated parts of Ontario and Quebec and in the rest of Canada."}, "resources": [{"url": "http://maps.geogratis.gc.ca/wms/emerald_ash_borer_reg_area?service=wms&request=getCapabilities&version=1.3.0&layers=emerald_ash_borer_reg_area", "contentType": "WMS", "name": {"fr": "FR - CFIA Emerald Ash Borer Regulated Areas", "en": "CFIA Emerald Ash Borer Regulated Areas"}, "language": "eng,fra", "format": "XML"}, {"url": "http://cartes.geogratis.gc.ca/wms/lieux_reg_agrile_du_frene?service=wms&request=getCapabilities&version=1.3.0&layers=lieux_reg_agrile_du_frene", "contentType": "WMS", "name": {"fr": "FR - ACIA Lieux règlementés de l'agrile du frêne", "en": "ACIA Lieux règlementés de l'agrile du frêne"}, "language": "eng,fra", "format": "XML"}], "metadata_contact": {"fr": "Gouvernement du Canada; Ressources naturelles Canada; Secteur des sciences de la Terre; Centre canadien de cartographie et d'observation de la Terre,voix; 1 (800) 661-2638 (Sans Frais au Canada et au États-Unis.),geoginfo-fr@RNCan.gc.ca", "en": "Government of Canada; Natural Resources Canada; Earth Sciences Sector; Canada Centre for Mapping and Earth Observation,voice; 1 (800) 661-2638 (Toll Free in Canada and USA.),geoginfo-en@NRCan.gc.ca"}}
